import Card from "../Card"
import Logement from "../../pages/Logement"

function Cards (logements) {
    return (
    <div className="cards">
        {logements.map(logement =>
            Card(logement)
        )}
        {logements.map(logement =>
            Logement(logement)
        )}
    </div>
    )
}

export default Cards
